function Welcome({ Login, error }) {

    const [details, setDetails] = useState({name: "", email: "", password: ""})

    const submitHandler = e => {
        e.preventDefault();

        Login(details);
    }

    return (
        <form onSubmit={submitHandler}>
            <div>
                {(error != "") ? ( <div className="error">{error}</div> ) : ""}
            <h1>BLABLA</h1>
            </div>
        </form>
    )
}

export default Welcome;
